import styled from 'styled-components'

export const FormContainer = styled.form`
  display: flex;
  flex-direction: column;
  max-width: 250px;
  background-color: #fff;
  padding: 24px;
  border-radius: 12px;
`

export const Titulo = styled.h2`
  font-size: 22px;
  font-weight: bold;
  margin-bottom: 16px;
`
